    (function initADRight160() {
        var isHomePage = window.location.origin.split("/").join("") == window.location.href.split("/").join("");
        var hasShownAreasRight300 = $("#adAreasRight300").length > 0;
        var isSmallScreen = $(".body-wrapper")[0].getBoundingClientRect().left < 170;
        if (isHomePage || hasShownAreasRight300 || isSmallScreen) {
            $("#adRight160").remove();
        } else {
            $("#adRight160").show();
            $("#adRight160 ins").css("display", "inline-block");
            $(window).resize(function () {
                adjustADRight160();
            });
            adjustADRight160();
            (adsbygoogle = window.adsbygoogle || []).push({});
        }
    })();
    function adjustADRight160() {
        if ($("#adRight160").length > 0) {
            var rec = $(".body-wrapper")[0].getBoundingClientRect();
            $("#adRight160").css("left", rec.left + rec.width + 10);
            $("#adRight160").css("top", rec.top + 25);
        }
    };                    
});
